/*Table structure for table `college_contact_details` */

DROP TABLE IF EXISTS `college_contact_details`;

CREATE TABLE `college_contact_details` (
  `college_ct_id` int(11) NOT NULL AUTO_INCREMENT,
  `college_id` int(11) NOT NULL,
  `contact_name` varchar(64) CHARACTER SET latin1 DEFAULT NULL,
  `designation` varchar(64) DEFAULT NULL,
  `responsibility` varchar(64) DEFAULT NULL,
  `contact_mobile` varchar(15) CHARACTER SET latin1 DEFAULT NULL,
  `contact_alternate_mobile` varchar(15) DEFAULT NULL,
  `contact_phone` varchar(15) CHARACTER SET latin1 DEFAULT NULL,
  `contact_email` varchar(100) CHARACTER SET latin1 DEFAULT NULL,
  `contact_alternate_email` varchar(45) CHARACTER SET latin1 DEFAULT NULL,
  `status` tinyint(1) DEFAULT '1',
  `created_on` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `created_by` int(11) DEFAULT NULL,
  `modified_on` timestamp NULL DEFAULT NULL,
  `modified_by` int(11) DEFAULT NULL,
  `remarks` text CHARACTER SET latin1,
  PRIMARY KEY (`college_ct_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

