/*Table structure for table `college_course_master` */

DROP TABLE IF EXISTS `college_course_master`;

CREATE TABLE `college_course_master` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `college_id` int(11) NOT NULL,
  `degree_type_id` int(11) DEFAULT NULL,
  `degree_subtype_id` int(11) DEFAULT NULL,
  `course_id` int(11) NOT NULL,
  `staff_count` int(11) DEFAULT NULL,
  `hod_name` text,
  `hod_email` varchar(128) DEFAULT NULL,
  `hod_mobile` varchar(15) DEFAULT NULL,
  `status` tinyint(1) DEFAULT NULL,
  `created_on` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `created_by` int(11) DEFAULT NULL,
  `modified_on` timestamp NULL DEFAULT NULL,
  `modified_by` int(11) DEFAULT NULL,
  `deactive_on` timestamp NULL DEFAULT NULL,
  `deactivate_by` int(11) DEFAULT NULL,
  `remarks` text,
  PRIMARY KEY (`id`),
  KEY `id` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `college_course_master` */

/*Table structure for table `college_master` */

DROP TABLE IF EXISTS `college_master`;

CREATE TABLE `college_master` (
  `college_id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `college_name` varchar(128) CHARACTER SET latin1 NOT NULL,
  `university` int(11) DEFAULT NULL,
  `email` varchar(128) DEFAULT NULL,
  `phone` varchar(15) DEFAULT NULL,
  `state` int(11) DEFAULT NULL,
  `district` int(11) DEFAULT NULL,
  `city` int(11) DEFAULT NULL,
  `address` text,
  `landmark` text,
  `pincode` varchar(6) DEFAULT NULL,
  PRIMARY KEY (`college_id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;

