insert  into `section_masters`(`section_id`,`qp_id`,`terms_conditions`,`section_hint`,`section_type`,`question_type`,`section_question`,`question_image`,`section_subject`,`section_chapter`,`number_of_questions_section`,`marks_per_question`,`section_total`,`if_negative_marks`,`status`,`created_on`,`created_by`,`updated_on`,`updated_by`,`deleted_on`,`deleted_by`,`remarks`) values (1,2,'',NULL,1,NULL,NULL,NULL,1,11,4,1,4,NULL,NULL,'2016-01-27 12:40:17',NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,NULL),(2,2,'<p><strong style=\"font-size: 9pt; line-height: 100%;\">Read the passage given below and answer the questions that follow by choosing the answer from the given options:</strong></p>',NULL,2,1,'<p><strong>Coded Messages</strong></p>\r\n<p>Arabic mathematicians made tremendous contributions to cryptanalysis &ndash; the science of decoding scrambled messages. Their interest stemmed partially from their religion.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;The holy Koran contains revelations made by the Prophet Mohammed. The text contained dictated messages that the Prophet had received from the archangel Gabriel. However, these revelations were not necessarily placed in the order in which the Prophet had received them. To deduce the order of the revelations and place them in chronological context, Muslim scholars determined that some passages contained words coined more recently, and some contained words that were older.Then, they counted the frequencies of words in each revelation, paying attention to the frequencies of modern and ancient words. Passages which contained a greater frequency of modern words were considered to have been written later.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>In the ninth century, an Arab mathematician called A1-Kindi employed a similar technique to break encrypted messages &ndash; frequency analysis. Letters are ranked according to how commonly they occur. Then, the encrypted message is taken, and the most frequent letter appearing in the code is noted. The code is then compared to the language, and using the correspondence in rank, the encrypted message can be unscrambled. He described this in a book &ndash; A manuscript on deciphering cryptographic messages.</p>\r\n<p>&nbsp;</p>',NULL,1,14,4,1,4,NULL,NULL,'2016-01-27 12:47:47',NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,NULL),(3,2,'<p><span style=\"font-size: small; line-height: 6.72px;\">Look at the notes given below and complete the following paragraphs suitably. Do not add any new information.&nbsp;</span></p>',NULL,2,1,'<p>Computers &ndash; performing several functions &ndash; more efficient than human beings &ndash; calculating, designing and planning &ndash; used in many fields &ndash; desire to operate them &ndash; disadvantages</p>\r\n<p>Computers are machines that (1) _____ several functions. They work more efficiently than human beings. They calculate, design and plan. They (2) &nbsp;_______ in many fields. That is why, everybody (3) _____ to operate them. The future belongs to them. But like other good things, they (4) ________ disadvantages.</p>',NULL,1,10,4,1,4,NULL,NULL,'2016-01-27 12:50:46',NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,NULL),(4,2,'',NULL,1,1,'',NULL,20,21,22,1,22,NULL,NULL,'2016-01-27 13:39:15',NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,NULL),(5,2,'',NULL,1,NULL,NULL,NULL,20,22,16,1,16,NULL,NULL,'2016-01-27 13:41:40',NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,NULL),(8,1,'<p>Read the given passage carefully and choose the most appropriate option in your answer sheet:</p>',NULL,2,1,'<p>Decision making is a very vital part of our lives. This is because what we are today is largely a result of the decisions we took in the past. Similarly, whatever happens tomorrow will be a result of the decisions we take in the present.</p>\r\n<p>It is not possible to reverse a wrong decision taken in the past, but it is possible to train ourselves into becoming a good decision maker for the future. If we don&rsquo;t, we&rsquo;ll end up doing what we&rsquo;ve always done and thus get what we&rsquo;ve always got. Philosopher Walter Kaufman has called this Decedophobia.</p>\r\n<p>All sorts of decisions, big or small, relevant or irrelevant, conscious or unconscious, punctuate our lives. Sometimes, we don&rsquo;t even realize we are taking a decision.</p>\r\n<p>Those who avoid taking a decision leave everything to chance and fate with a &lsquo;what will be, will be&rsquo; attitude.</p>\r\n<p>To enhance our decision making, we must, first of all, gather as much information as possible about the issue before we make our decision. We might be heading for a failure if our decisions are based on half &ndash; baked information.</p>',NULL,1,2,5,1,5,NULL,NULL,'2016-01-28 10:16:05',NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,NULL),(9,1,'<p><strong>Fill in the blanks by choosing the appropriate option from the ones given below:</strong></p>',NULL,2,1,'<p>Those living in the slums are ____(1) ____. and tough because they are totally ____(2) ____ to the vagaries and hardships of life. The rising sun ____(3) ____. the day and the setting sun closes the day for them. It is like a drama where the curtain ____(4) ____ up in the morning and comes down in the evening. They don\'t ____(5) ____ hypertension and heart attacks because there is, after all, nothing to worry about.</p>',NULL,1,2,5,1,5,NULL,NULL,'2016-01-28 10:17:29',NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,NULL),(10,1,'<p><strong>Fill in the blank with the appropriate conjunction from the options given below:</strong></p>',NULL,1,NULL,NULL,NULL,1,2,5,0,5,NULL,NULL,'2016-01-28 10:18:48',NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,NULL),(11,1,'<p><strong>Fill in the blank with the appropriate verb form from the options given below:</strong></p>',NULL,1,NULL,NULL,NULL,1,2,5,1,5,NULL,NULL,'2016-01-28 10:19:51',NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,NULL),(12,1,'',NULL,1,NULL,NULL,NULL,20,21,20,1,20,NULL,NULL,'2016-01-28 10:20:35',NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,NULL),(13,1,'',NULL,1,NULL,NULL,NULL,20,22,20,1,20,NULL,NULL,'2016-01-28 10:23:44',NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,NULL),(14,3,'<p>Read the passage carefully and answer the questions that follow:</p>',NULL,2,1,'<p>In todays uncertain economy, raises are getting ever smaller and ever harder to come by. In order to get one, you need to get back to the good student attitude. Think back to your school days, when your job was merely to pass. The requirements were clearly spelt out. At the end of the year, every student who had done an adequate job was automatically promoted.</p>\r\n<p>Work is different. You cant expect the system to take care of you. You must take care of it. Too many of us forget this. When there is a lull in the workload for example, we sit around waiting for them to tell us what to do. If profits sink, we blame them for decisions that we knew to be bad  forgetting that we never tried to influence those decisions.</p>\r\n<p>To get a raise just doing your job well will not suffice. Thats exactly what you were hired for in the first place. Many of us already work beyond the boundaries of our jobs without realizing it. At the end of every workday, ask yourself, What have I done that wasnt called for in my job? This will give you an appraisal, a record of achievements and a reason to expect a raise.</p>',NULL,1,14,5,1,5,NULL,NULL,'2016-01-28 12:18:28',NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,NULL),(15,3,'<p>At first he opened a variety store which he had to __(1)___ after five years. Then he had a job in a Bengali firm which he ___(2)_____ in disgust when his boss began to treat him in a high-handed fashion. Then for ten long years, he tried every __(3)_______of earning a livelihood without ever succeeding in ___(4)___ his lot. Of late, he had been ____(5)_____regular visits to a small establishment dealing in scrap iron where he friend had promised a job.</p>',NULL,1,1,'',NULL,1,2,5,1,5,NULL,NULL,'2016-01-28 12:19:01',NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,NULL),(16,3,'<p><span style=\"line-height: 11px;\"><strong>Fill in the blank by choosing the correct verb form from the options given:</strong></span></p>',NULL,1,1,'',NULL,1,2,5,1,5,NULL,NULL,'2016-01-28 12:23:12',NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,NULL),(17,3,'<p style=\"margin-left: -0.39in; margin-bottom: 0in; text-align: left; padding-left: 30px;\" align=\"JUSTIFY\"><strong><span style=\"line-height: 11px;\">Fill in the blank by choosing the correct conjuction form from the options given:</span></strong></p>',NULL,1,1,'',NULL,1,2,5,1,5,NULL,NULL,'2016-01-28 12:23:51',NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,NULL),(18,3,'',NULL,1,NULL,NULL,NULL,20,21,20,1,20,NULL,NULL,'2016-01-28 12:24:38',NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,NULL),(19,3,'',NULL,1,NULL,NULL,NULL,20,22,20,1,20,NULL,NULL,'2016-01-28 12:24:56',NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,NULL),(20,4,'<p>Read the passage carefully and answer the questions that follow:</p>',NULL,2,1,'<p>The rag pickers of India present a pitiable sight. It is poverty that goads them to resort to rag picking. Day in and day out, they may be seen on the roads, the lanes and the by lanes of a city or town, looking for cast-off clothes or something else showy or shoddy that will sell. More often than not, it is children who take to rag picking. But some young men and women are also forced to take up the trade to make both ends meet. Why should innocent children who should be at school at this age do this filthy job? It is because their parents are often too poor to support them; so they neglect them and abandon them to face the cruel world on their own.</p>\r\n<p>The people roam about streets and bazaars picking up from the dust-bins, any wasted-out or torn and tattered clothes; and they do not hesitate to search for rags even in evil smelling garbage or sewage or cesspools. They carry bags on their backs and store their fuels in them. Very often, the individuals divide a city into zones, and each zone is allotted to a particular group, by mutual consent. The intrusion of one group into another zone is resented and sometimes even results in fights.</p>\r\n<p>Very often, young men who take to rag picking are the ones who come from villages to cities in search of jobs; and finding none, they take to rag picking out of sheer helplessness and desperation.</p>',NULL,1,14,5,1,5,NULL,NULL,'2016-01-28 15:21:38',NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,NULL),(21,4,'<p><strong style=\"line-height: 100%;\">Fill in the blanks with the appropriate word from the options given below:</strong></p>',NULL,2,1,'<p>By measuring our ecological ____(1)______ we can assess our ____(2)______ on the planet.&nbsp;This will help us ___(3)______ our ecological assets more wisely and _____(4)_______ personal and collective action in support of a world where humanity lives within the Earth&rsquo;s ____(5)_______. &nbsp;</p>',NULL,1,2,5,1,5,NULL,NULL,'2016-01-28 15:22:41',NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,NULL),(22,4,'<p><strong style=\"line-height: 100%;\">Fill in the blank by choosing the correct verb form from the options given:</strong></p>',NULL,1,NULL,NULL,NULL,1,2,5,1,5,NULL,NULL,'2016-01-28 15:23:08',NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,NULL),(23,4,'<p><strong style=\"line-height: 100%;\">Fill in the blank by choosing the correct conjunction from the options given:</strong></p>',NULL,1,NULL,NULL,NULL,1,2,5,1,5,NULL,NULL,'2016-01-28 15:23:37',NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,NULL),(24,4,'',NULL,1,1,'',NULL,20,21,20,1,20,NULL,NULL,'2016-01-28 15:23:56',NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,NULL),(25,4,'',NULL,1,NULL,NULL,NULL,20,22,20,1,20,NULL,NULL,'2016-01-28 15:24:13',NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,NULL),(26,5,'',NULL,1,NULL,NULL,NULL,32,34,20,1,20,NULL,NULL,'2016-03-07 04:54:29',NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,NULL),(27,5,'',NULL,1,NULL,NULL,NULL,33,35,20,1,20,NULL,NULL,'2016-03-07 04:54:49',NULL,'0000-00-00 00:00:00',