/* Procedure structure for procedure `create_users_candidate` */

/*!50003 DROP PROCEDURE IF EXISTS  `create_users_candidate` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `create_users_candidate`(
	IN _email VARCHAR(255)
)
BEGIN
    INSERT INTO users (`name`, email, reg_id, user_type, login_attempt)
    SELECT `first_name`, email, id, 1, 0 FROM candidate_master WHERE email = _email;
END */$$
DELIMITER ;

/* Procedure structure for procedure `select_questionpaper_first_last` */

/*!50003 DROP PROCEDURE IF EXISTS  `select_questionpaper_first_last` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `select_questionpaper_first_last`(IN _search_key VARCHAR(255),IN _status VARCHAR(1),IN _college_id int(11))
BEGIN 
select min(s1.id) as first,max(s1.id) as last from (SELECT @n := @n +1 AS id,qp_id
FROM `question_paper_masters` AS a, (SELECT @n := 0) m
WHERE a.status = _status and a.college_id = _college_id AND  (a.qp_id LIKE CONCAT('%',_search_key,'%') OR a.title LIKE CONCAT('%',_search_key,'%'))) as s1;
END */$$
DELIMITER ;

/* Procedure structure for procedure `select_questions` */

/*!50003 DROP PROCEDURE IF EXISTS  `select_questions` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `select_questions`(IN _action varchar(6),IN _action_val int(11),IN _search_key VARCHAR(255),IN _status VARCHAR(1),IN _college_id INT(11))
BEGIN 
IF _action='<' THEN 
SELECT * FROM (select * from (SELECT @n := @n +1 AS id,qp_id,title,number_of_questions,total_marks,duration,created_on 
FROM `question_paper_masters` AS a, (SELECT @n := 0) m
WHERE a.status = _status AND a.college_id = _college_id  AND  (a.qp_id LIKE CONCAT('%',_search_key,'%') OR a.title LIKE CONCAT('%',_search_key,'%'))) as s1 WHERE s1.id < _action_val order by s1.id desc limit 7) as s2 order by s2.id asc;
END IF;
IF _action='>' THEN 
select * from (SELECT @n := @n +1 AS id,qp_id,title,number_of_questions,total_marks,duration,created_on 
FROM `question_paper_masters` AS a, (SELECT @n := 0) m
WHERE a.status = _status AND a.college_id = _college_id  AND  (a.qp_id LIKE CONCAT('%',_search_key,'%') OR a.title LIKE CONCAT('%',_search_key,'%'))) as s1 where s1.id > _action_val limit 7;
END IF;
END */$$
DELIMITER ;

/* Procedure structure for procedure `select_tests` */

/*!50003 DROP PROCEDURE IF EXISTS  `select_tests` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `select_tests`(IN _action VARCHAR(6),IN _action_val INT(11),IN _search_key VARCHAR(255),IN _status varchar(1))
BEGIN 
IF _action='<' THEN 
SELECT * FROM (SELECT * FROM (SELECT @n := @n +1 AS id,test_id,title,terms_conditions,test_password,is_negative,is_question_random,is_option_random,test_url,qp_id,number_of_questions,total_marks,duration,created_on 
FROM `test_masters` AS a, (SELECT @n := 0) m
WHERE  a.status = _status and (a.test_id LIKE CONCAT('%',_search_key,'%') OR a.title LIKE CONCAT('%',_search_key,'%'))) AS s1 WHERE s1.id < _action_val ORDER BY s1.id DESC LIMIT 7) AS s2 ORDER BY s2.id ASC;
END IF;
IF _action='>' THEN 
SELECT * FROM (SELECT @n := @n +1 AS id,test_id,title,terms_conditions,test_password,is_negative,is_question_random,is_option_random,test_url,qp_id,number_of_questions,total_marks,duration,created_on 
FROM `test_masters` AS a, (SELECT @n := 0) m
WHERE a.status = _status AND (a.test_id LIKE CONCAT('%',_search_key,'%') OR a.title LIKE CONCAT('%',_search_key,'%'))) AS s1 WHERE s1.id > _action_val LIMIT 7;
END IF;
END */$$
DELIMITER ;

/* Procedure structure for procedure `select_test_first_last` */

/*!50003 DROP PROCEDURE IF EXISTS  `select_test_first_last` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `select_test_first_last`(IN _search_key VARCHAR(255),IN _status VARCHAR(1))
BEGIN 
SELECT MIN(s1.id) AS first,MAX(s1.id) AS last FROM (SELECT @n := @n +1 AS id,test_id,title,terms_conditions,test_password,is_negative,is_question_random,is_option_random,test_url,qp_id,number_of_questions,total_marks,duration,created_on 
FROM `test_masters` AS a, (SELECT @n := 0) m
WHERE  a.status = _status AND (a.test_id LIKE CONCAT('%',_search_key,'%') OR a.title LIKE CONCAT('%',_search_key,'%'))) AS s1;
END */$$
DELIMITER ;

